const Login = () => {
  const checkLogin = (e) => {
    e.preventDefault();
  };

  return (
    <>
      <h1>ログイン</h1>
      <form onSubmit={''} className='signup-form'>
        <input
          type='email'
          placeholder='ログインID（メールアドレス）'
          value={''}
          onChange={(e) => {}}
          className='input-field'
        />
        <input
          type='password'
          placeholder='パスワード'
          value={''}
          onChange={(e) => {}}
          className='input-field'
        />
        <button
          type='submit'
          className='submit-button'
          onClick={(e) => checkLogin}
        >
          ログイン
        </button>
      </form>
    </>
  );
};

export default Login;
